				<Navbar.Brand href="#home">Stefans To Do App</Navbar.Brand>
				<Form inline>
					<FormControl type="text" placeholder="enter new to do item" className="mr-sm-2"
								 onChange={e => this.addItem()}/>
					<Button variant="outline-success" onClick={() => this.addItem()}>Add</Button>
				</Form>
			</Navbar>
		)
	}

